My Daughter the Teenage Nudist

Culture Documentary hosted by Mathew Horne, published by Channel 4 in 2013 - English narration


Information
------------------------------

My Daughter the Teenage Nudist
Mollie and Alex are part of a growing group of teens and twentysomethings embracing the world of public nudity - a contemporary phenomenon that's been driven by social networking sites such asas well as niche websites like Naked Vegan Cooking. They are on a quest to normalise nudity, question the media's obsession with the body beautiful, and encourage other young people to liberate themselves by simply going naked - in the streets, in cafes or at art shows. The new nudists are keen to take the nudist lifestyle beyond the old fashioned naturist clubs. So why is this pastime increasing in popularity and what do the parents think about their child revealing all in the most public of places?

